DROP TRIGGER Tri_UMainMenuConfig_ByInfo
GO

CREATE TRIGGER Tri_UMainMenuConfig_ByInfo ON MainMenuInfo FOR INSERT, UPDATE, DELETE AS Declare @id_1 int, @defaultIndex_1 int, @countdelete   int, @countinsert   int, @userId int, @isCustom char(1), @useCustomName char(1), @customName varchar(100)   SELECT @countdelete = count(*) FROM deleted SELECT @countinsert = count(*) FROM inserted   IF (@countinsert > 0 AND @countdelete = 0) BEGIN  SELECT @id_1 = id,@defaultIndex_1 = defaultIndex,@isCustom=isCustom,@useCustomName=useCustomName,@customName=customName FROM inserted  if(@isCustom = 0 OR @isCustom IS NULL) BEGIN   DECLARE hrmCompany_cursor CURSOR FOR SELECT id FROM HrmCompany order by id  OPEN hrmCompany_cursor FETCH NEXT FROM hrmCompany_cursor INTO @userId  WHILE @@FETCH_STATUS = 0 BEGIN  INSERT INTO MainMenuConfig (userId,infoId,visible,viewIndex,resourceid,resourcetype,locked,lockedById,useCustomName,customName) VALUES(0,@id_1,1,@defaultIndex_1,@userId,'1',0,0,@useCustomName,@customName)  FETCH NEXT FROM hrmCompany_cursor INTO @userId END CLOSE hrmCompany_cursor DEALLOCATE hrmCompany_cursor  DECLARE hrmSubCompany_cursor CURSOR FOR SELECT id FROM HrmSubCompany order by id  OPEN hrmSubCompany_cursor FETCH NEXT FROM hrmSubCompany_cursor INTO @userId  WHILE @@FETCH_STATUS = 0 BEGIN INSERT INTO MainMenuConfig (userId,infoId,visible,viewIndex,resourceid,resourcetype,locked,lockedById,useCustomName,customName) VALUES(0,@id_1,1,@defaultIndex_1,@userId,'2',0,0,@useCustomName,@customName) FETCH NEXT FROM hrmSubCompany_cursor INTO @userId END CLOSE hrmSubCompany_cursor DEALLOCATE hrmSubCompany_cursor   end END   IF (@countinsert = 0) BEGIN  SELECT @id_1 = id FROM deleted  DELETE FROM MainMenuConfig WHERE infoId = @id_1 END 
GO

